<script>
  let TweenMax = window.TweenMax
  let SplitText = window.SplitText
  let TimelineMax = window.TimelineMax
  let Bounce = window.Bounce
  let Sine = window.Sine
  export default {
    data () {
      return {
        message: 'This is a good place to type things.',
        load: false
      }
    },
    methods: {
      beforeEnter (el) {
        TweenMax.set(el, {
          transformPerspective: 600,
          perspective: 300,
          transformStyle: 'preserve-3d',
          autoAlpha: 1
        })
      },
      enter (el, done) {
        // 不太明白为什么一直不行，去掉吧
        console.log(el)
        let split = new SplitText(el, {
          type: 'words'
        })
        let wordCount = 0
        let t1 = new TimelineMax({
          onComplete: done
        })
        for (let i = 0; i < wordCount; i++) {
          TweenMax.set(split.words[i], {
            x: Math.floor(Math.random() * (1 + 300 - -300) + -300)
          })
        }

        t1.add('drop')

        for (let i = 0; i < wordCount; i++) {
          t1.from(split.words[i], 1.5, {
            z: Math.floor(Math.random() * (1 + 150 - -150) + -150),
            ease: Bounce.easeOut
          }, 'drop+=0.' + ([i] / 0.5))
          t1.fromTo(split.words[i], 1.5, {
            y: -800,
            ease: Bounce.easeOut
          }, 'drop+=0.' + ([i] / 0.5))
          t1.to(split.words[i], 0.5, {
            rotation: 720,
            y: 0,
            x: 0,
            z: 0,
            ease: Sine.easeIn
          }, 'drop+=1.' + (5 + [i] / 0.5))
        }
      }
    }
  }
</script>

